def xor(a, b):
    return bytes([i ^ j for i,j in zip(a,b)])

s = ""
s = list(bytes.fromhex(s))

for i in range(0, len(s), 2):
    s[i], s[i + 1] = s[i + 1], s[i]

s = bytes(s)

final = ''

for i in s:
    t = hex(i)[2:]
    if (len(t) == 1):
        final += "\\x" + "0" + t
    else:
        final += "\\x" +t

print(final)